import React from 'react';
import SchemeList from './SchemeList';
import './SavedScheme.css';

const SavedScheme = ({ savedSchemes }) => {
  if (savedSchemes.length === 0) {
    return <p>You have not saved any schemes yet.</p>;
  }

  // Extract the scheme data from the savedScheme objects
  const schemes = savedSchemes.map(saved => saved.scheme);
  
  return <SchemeList schemes={schemes} />;
};

export default SavedScheme;
